import React, { Component } from 'react';
import '../../scss/Works.scss';
import ScrollAnimation from 'react-animate-on-scroll';
import Project from './Project/Project';

import firstImg from '../../img/restoImg.jpg';
import secondImg from '../../img/td2Img.jpg';
import thirdImg from '../../img/allezcineImg.jpg';
import fourthImg from '../../img/hitmanImg.jpg';

// import ChipsHTML from './Chips/ChipsHTML';
// import ChipsSASS from './Chips/ChipsSASS';
// import ChipsBootstrap from './Chips/ChipsBootstrap';
// import ChipsJavascript from './Chips/ChipsJavascript';
// import ChipsAPI from './Chips/ChipsAPI';

const Style = {
    displayProjects: {
        display: 'flex',
        flexDirection: 'row',
        flexWrap: 'wrap',
        justifyContent: 'center'
    }
}

export default class Works extends Component {
    render() {
        return (

            <div className="works" id="myWorks" style={Style.displayProjects}>

                <ScrollAnimation animateIn="bounceInLeft">
                    <Project 
                        imgUrl={firstImg}
                    />
                    {/* <ChipsHTML />
                    <ChipsSASS />
                    <ChipsBootstrap /> */}
                </ScrollAnimation>

                <ScrollAnimation animateIn="bounceInRight">
                    <Project 
                        imgUrl={secondImg}
                    />
                    {/* <ChipsHTML />
                    <ChipsSASS />
                    <ChipsJavascript /> */}
                </ScrollAnimation>

                <ScrollAnimation animateIn="bounceInLeft">
                    <Project 
                        imgUrl={thirdImg}
                    />
                    {/* <ChipsHTML />
                    <ChipsSASS />
                    <ChipsJavascript />
                    <ChipsBootstrap />
                    <ChipsAPI /> */}
                </ScrollAnimation>

                <ScrollAnimation animateIn="bounceInRight">
                    <Project 
                        imgUrl={fourthImg}
                    />
                    {/* <ChipsHTML />
                    <ChipsSASS />
                    <ChipsJavascript />
                    <ChipsBootstrap />
                    <ChipsAPI /> */}
                </ScrollAnimation>

                <ScrollAnimation animateIn="wobble" initiallyVisible={true}>
                    <p>Cette section sera régulièrement mise à jour</p>
                </ScrollAnimation>

            </div>
        );
    }
}
